import { createBrowserRouter, Outlet, RouterProvider, ScrollRestoration } from "react-router-dom";

import Header from '../components/assets/header/header.jsx';
import Footer from '../components/assets/footer/footer.jsx';
import Main from '../pages/main/main.jsx';
import About from '../pages/about/about.jsx';
import NewsList from '../pages/news/newslist/newslist.jsx';
import News from "../pages/news/newslist/news.jsx";
import Contacts from "../pages/contacts/contacts.jsx";
import ErrorPage from "../pages/errorpage/errorpage.jsx";
import Breadcrumbs from "../components/breadcrumbs/breadcrumbs.jsx";

const Router = () => {
function Layout() {
  return (
    <div className="App">
        <Header />
        <Breadcrumbs/>
        <Outlet />
        <Footer />
        <ScrollRestoration />
      </div>
  );
}

const router = createBrowserRouter([
  {
    element: <Layout/>,
    errorElement: <ErrorPage />,
    children: [  
      {
        path: '/',
        element: <Main />,
        data: 'Главная',
        handle: {
          crumb: (data) => <span>{data}</span>,
        }
      },
      {
        path: '/about',
        element: <About />,
        handle: {
          crumb: (data) => <span>{data="О нас"}</span>,
        }
      },
      {
        path: '/newslist',
        element: <Outlet />,
        children: [
          {
            index: true,
            element: <NewsList />,
            handle: {
              crumb: (data) => <span>{data="Новости"}</span>,
            }
          },
          {
            path: 'news/:id',
            element: <News />,
            handle: {
              crumb: (data) => <span>{data="новость"}</span>,
            }
          },
        ]
      },
      {
        path: '/contacts',
        element: <Contacts />
      }
    ]
  }
])

return <RouterProvider router={router} />
}

export default Router;
